import React, { Component } from 'react';
import Eye from './Eye';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import './styles/css/Footer.css';

export default class Footer extends Component {

	render() {
		return (
			<footer>
				<div className="footer__container">
					<Router>
						<div className="App">
							<Route component={Eye} />
						</div>
					</Router>
					<ul>
						<li className="twitter">
							<a href="https://twitter.com/rachel_web" rel="nofollow"><img src="images/twitter.png" height="26px" width="auto" /></a>
						</li>
						<li className="linkedin">
							<a href="https://uk.linkedin.com/in/rachel-bull-b3535536" rel="nofollow"><img src="images/linkedin.png" height="26px" width="auto" /></a>
						</li>
						<li className="email">
							<a href="mailto:rachel13bull@gmail.com?Subject=Exmail%20afrom%20rachel13bull.github.io" rel="nofollow" target="_top"><img src="images/email.png" height="26px" width="auto" /></a>
						</li>
					</ul>
				</div>
			</footer>
		)
	}
}
